import React from 'react';
import DeleteIcon from '@material-ui/icons/Delete';

    const List = (props) => {
        return (
        <>
        <div>
            <span><DeleteIcon/></span>
        <li> {props.text} </li>
        </div>
        
        </>
          )  }


export default List;
